import React from 'react';
import './loginPage.css';
import {Navbar, LoginForm} from '../../components';

const LoginPage = () => {
  return (
    <div className='LoginPage'>
        <div className='LoginPage-top'>
            <Navbar></Navbar>
        </div>
        <div className='LoginPage-bottom'>
            <LoginForm></LoginForm>
        </div>
    </div>
  )
}

export default LoginPage
